import React from 'react';
import { BrowserRouter, Route } from 'react-router-dom';

const pageOne = () => (
    <div>Page One</div>
)

const pageTwo = () => (
    <div>Page Two</div>
)

const App = () => {
    return <div>
        <BrowserRouter>
        <Route path='/' exact component={pageOne} />

        </BrowserRouter>
    </div>;
};

export default App;
